import React from 'react';


function nav()
{
return(
    <div id="navi">
    <div className="sidenav">
                     {
                       this.state.showHometag?
                       <a href="#Home" id="homebtn"onClick={this.homeredirect}>Home</a>
                       :null
                     }
                     {this.state.showLoc?
                     <a href="#Locationid?" id="locbtn"onClick={this.redirect}>Locations</a>
                   :null}
 
                    </div>
    </div>
);
}
export default nav;
